import React from 'react'

type Props = {}

export const Purchase = (props: Props) => {
  return (
    <div>

        <div className='flex'>
            <section className='px-3 py-4 rounded-full bg-blue-400 flex justify-center items-center'>
                <img src="/images/payment.png" alt="payment" className='object-contain w-[60%]' />
            </section>
        </div>


    </div>
  )
}
